import React from 'react'

const SectionRecommend = () => {
  return (
    <section className='page__recommend'>
        <div className="recommend__container">
            <div className="recommend__title">Почему NURA ELITE?</div>
        </div>
    </section>
  )
}

export default SectionRecommend
